/* eslint-disable no-param-reassign */

const { TD3 } = require('../formats');

const { getValidLines } = require('../checkLines');
const getResult = require('../getResult');
const TD3Fields = require('./td3Fields');

module.exports = function parseTD3(mrzLines) {
  const lines = getValidLines(mrzLines, 2, 44, TD3);

  return getResult(TD3, lines, TD3Fields);
};
